import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import Logout from "../Logout";
import { getUserSchedule } from "../../utils/APIRoutes";
import axios from "axios";

import loaderImage from "../../assets/loader.gif";
import { useParams } from "react-router-dom";

const IndividualInstructor = () => {
  const navigate = useNavigate();
  const { username } = useParams();
  const [currUser, setCurrUser] = useState(undefined);
  const [schedules, setSchedules] = useState([]);
  const [loading, setLoading] = useState(true);

  const adminKey = localStorage.getItem("secret-key-admin");

  useEffect(() => {
    if (!adminKey) {
      localStorage.clear();
      navigate("/");
    }
  }, [adminKey, navigate]);

  useEffect(() => {
    setCurrUser(username);

    const fetchSchedules = async () => {
      try {
        const response = await axios.get(getUserSchedule, {
          params: { currUser: username },
        });
        setSchedules(response.data.schedules);
      } catch (error) {
        console.error("Error fetching Schedule:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchSchedules();
  }, [currUser, navigate]);

  if (loading) {
    return (
      <LoaderContainer>
        <LoaderImage src={loaderImage} alt="Loading..." />
      </LoaderContainer>
    );
  }

  return (
    <WelcomeContainer>
      <TopBar>
        <Logout />
        <Heading>Welcome Admin</Heading>
      </TopBar>
      <MainContent>
        <LecturesContainer>
          <SectionHeading>Upcoming Lectures For {currUser}</SectionHeading>
          <ScrollableContent>
            {schedules.map((schedule, index) => (
              <LectureCard key={index}>
                <CardHeading>Course:</CardHeading>
                <CourseContent>{schedule.course}</CourseContent>

                <CardHeading>Lecture:</CardHeading>
                <LectureContent>{schedule.lecture}</LectureContent>

                <CardHeading>Date:</CardHeading>
                <DateContent>
                  {new Date(schedule.date).toLocaleDateString()}
                </DateContent>

                <CardHeading>Location:</CardHeading>
                <LocationContent>{schedule.location}</LocationContent>
              </LectureCard>
            ))}
          </ScrollableContent>
        </LecturesContainer>
      </MainContent>
    </WelcomeContainer>
  );
};

const LoaderContainer = styled.div`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #121212; /* Dark background */
`;

const LoaderImage = styled.img`
  width: 80px;
  height: 80px;
`;

// Main container
const WelcomeContainer = styled.div`
  height: 100vh;
  width: 100vw;
  background-color: #1e1e1e; /* Dark background */
  padding-bottom: 1rem;
`;

// Top bar
const TopBar = styled.div`
  width: 100%;
  background: #2c2c2c; /* Darker background */
  padding: 25px;
  display: flex;
  justify-content: space-between;
`;

// Heading
const Heading = styled.h1`
  color: #e0e0e0; /* Light text color */
  font-size: 36px;
  font-weight: bold;
  margin-top: 10px;
`;

// Main content
const MainContent = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  gap: 1rem;
  padding: 10px;
  overflow: hidden;
  width: 100%;
`;

// Lectures container
const LecturesContainer = styled.div`
  width: 100%;
`;

// Scrollable content
const ScrollableContent = styled.div`
  display: flex;
  flex-wrap: wrap-reverse;
  justify-content: space-around;
  gap: 1rem;
  max-height: 450px;
  overflow-y: auto;
`;

// Individual lecture card
const LectureCard = styled.div`
  background-color: #2c2c2c; /* Darker background */
  border-radius: 15px;
  padding: 25px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
  margin-top: 10px;
  width: 40%;
  box-sizing: border-box;
`;

// Section heading
const SectionHeading = styled.h2`
  color: #e0e0e0; /* Light text color */
  font-size: 24px;
  margin: 15px;
`;

// Card headings
const CardHeading = styled.h3`
  color: #e0e0e0; /* Light text color */
  font-size: 25px;
  margin-bottom: 10px;
`;

// Card content
const CardContent = styled.p`
  margin-bottom: 15px;
  font-size: 18px;
  color: #b0b0b0; /* Light grey text */
`;

// Unique styles for each card content
const CourseContent = styled(CardContent)`
  color: #ffd700; /* Gold */
  font-weight: bold;
  font-size: 20px;
`;

const LectureContent = styled(CardContent)`
  color: #e0e0e0; /* Light text color */
  font-style: italic;
`;

const DateContent = styled(CardContent)`
  color: #d4a2b0; /* Soft pink */
  font-weight: bold;
`;

const LocationContent = styled(CardContent)`
  color: #b0b0b0; /* Light grey text */
  font-size: 16px;
`;

export default IndividualInstructor;
